    //符号
    symbol(name,x,y) {
        var right = this.add.image(x, y, name);
        right.setDepth(2)
        right.scaleX = 0.5
        right.scaleY = 0.5
        console.log(this)
        this.tweens.add({
            targets: [right],
            rotation: 0.15,
            duration: 200,
            callbackScope: this,
            onComplete: function (tween) {
                this.tweens.add({
                    targets: [right],
                    rotation: -0.15,
                    duration: 200,
                    callbackScope: this,
                    onComplete: function (tween) {
                        right.destroy()
                    }
                });
            }
        });

    }

